import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

const EmployeeList = () => {
  // Sample employee data

  const [employees, setEmployees] = useState([
    {
      id: 1,
      image: 'path-to-image', // You can put an image URL here
      name: 'hukum',
      email: 'hcgupta@cstech.in',
      mobile: '954010044',
      designation: 'HR',
      gender: 'Male',
      course: 'MCA',
      createDate: '13-Feb-21',
    },
    {
      id: 2,
      image: 'path-to-image',
      name: 'manish',
      email: 'manish@cstech.in',
      mobile: '954010033',
      designation: 'Sales',
      gender: 'Male',
      course: 'BCA',
      createDate: '12-Feb-21',
    },
    {
      id: 3,
      image: 'path-to-image',
      name: 'yash',
      email: 'yash@cstech.in',
      mobile: '954010002',
      designation: 'Manager',
      gender: 'Male',
      course: 'BSC',
      createDate: '11-Feb-21',
    },
    {
      id: 4,
      image: 'path-to-image',
      name: 'abhishek',
      email: 'abhishek@cstech.in',
      mobile: '954010033',
      designation: 'HR',
      gender: 'Male',
      course: 'MCA',
      createDate: '13-Feb-21',
    },
  ]);
  let navigate = useNavigate(); 
  const routeChange = (e) =>{  
    e.preventDefault();
    navigate('/CreateEmployee');
  }

  const [searchTerm, setSearchTerm] = useState('');

  const handleSearchChange = (e) => {
    setSearchTerm(e.target.value);
  };

  const filteredEmployees = employees.filter((employee) =>
    employee.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  const handleEdit = (e) => {
    e.preventDefault();
    navigate('/EmployeeEdit');
  };

  const handleDelete = (id) => {
    setEmployees(employees.filter((employee) => employee.id !== id));
  };

  return (
    <div className="employee-list">
      <header className="header">
        <h1>Employee List</h1>
        <div className="header-controls">
          <span>Total Count: {employees.length}</span>
          <button onClick={routeChange}>
            Create Employee
          </button>
          <input
            type="text"
            placeholder="Enter Search Keyword"
            value={searchTerm}
            onChange={handleSearchChange}
          />
        </div>
      </header>

      <table>
        <thead>
          <tr>
            <th>Unique Id</th>
            <th>Image</th>
            <th>Name</th>
            <th>Email</th>
            <th>Mobile No</th>
            <th>Designation</th>
            <th>Gender</th>
            <th>Course</th>
            <th>Create date</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {filteredEmployees.length > 0 ? (
            filteredEmployees.map((employee) => (
              <tr key={employee.id}>
                <td>{employee.id}</td>
                <td>
                  <img
                    src={employee.image}
                    alt={employee.name}
                    width="50"
                    height="50"
                  />
                </td>
                <td>{employee.name}</td>
                <td>
                  <a href={`mailto:${employee.email}`}>{employee.email}</a>
                </td>
                <td>{employee.mobile}</td>
                <td>{employee.designation}</td>
                <td>{employee.gender}</td>
                <td>{employee.course}</td>
                <td>{employee.createDate}</td>
                <td>
                  <button onClick={handleEdit}>Edit</button>
                  <button onClick={() => handleDelete(employee.id)}>
                    Delete
                  </button>
                </td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan="10">No Employees Found</td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default EmployeeList;
